import React from 'react';
import './Header.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faPen, faUser, faUsers } from '@fortawesome/free-solid-svg-icons';

const Header = () => {
  return (
    <header className="header">
      <div className="header-container">
        <div className="logo">
          <h1>MomsBlog</h1>
          <span className="logo-subtitle">Сообщество мам</span>
        </div>
        <div className="search-bar">
          <FontAwesomeIcon icon={faSearch} className="search-icon" />
          <input type="text" placeholder="Поиск постов, советов, обсуждений..." />
        </div>
        <div className="header-actions">
          <button className="btn-write">
            <FontAwesomeIcon icon={faPen} />
            Написать пост
          </button>
          <a href="#" className="login-link">
            <FontAwesomeIcon icon={faUser} />
            Войти
          </a>
        </div>
      </div>
    </header>
  );
};

export default Header;
